name ENDS
.code
MAIN PROC FAR
	                              mov              AX,@data                                                                             	;initializing the data segemnt
	                              mov              DS,AX
	;///////////////////////////////First Screen////////////////////////////////////

	firstScreenLoop:              
	                              mov              ax, graphicsModeAX                                                                   	; enter graphicsMode
	                              mov              bx, graphicsModeBX                                                                   	; BX = 81FFh
	                              int              10h

	                              mov              ah,09h
	                              lea              dx, firstScreen                                                                      	; show the first screen
	                              int              21h

	                              mov              ah,09h
	                              lea              dx, getName                                                                          	; ask for player's name
	                              int              21h

	getNameLoop:                  lea              si, playerName1                                                                      	; get player's name
	                              mov              ah, 0Ah
	                              mov              dx, si
	                              int              21h

	; TODO check of the name is valid
	; mov bp, offset playerName1 + 1
	; or           [bp], 0
	; jnz            mainMenuLoop

	; mov            ah,09h
	; lea            dx, enterValidName      	; ask for a valid player's name
	; int            21h
	; jmp            getNameLoop
	;///////////////////////////////Main Menu////////////////////////////////////
	mainMenuLoop:                 
	                              clearWholeScreen
	                              mov              ax, graphicsModeAX                                                                   	; enter graphicsMode
	                              mov              bx, graphicsModeBX                                                                   	; BX = 81FFh
	                              int              10h
	;call             background
	                              call             drawgamebtn
	                              call             drawchatbtn
	                              call             drawexitbtn
	                              call             drawArrows
	                              call             drawLogo

	CheckInMainMenu:              
	                              mov              ah,0                                                                                 	;  ah:al = scan code: ASCII code
	                              int              16h

	                              cmp              ah, key_upArrow                                                                      	; up arrow
	                              jne              downArrow_label
	                              cmp              arrowoffsetY, arrowAtgame
	                              je               CheckInMainMenu
	                              call             eraseArrows
	                              mov              bx, arrowStep
	                              SUB              arrowoffsetY, bx
	                              call             drawArrows
	                              jmp              CheckInMainMenu

	downArrow_label:              cmp              ah, key_downArrow                                                                    	; down arrow
	                              jne              enterKey_label
	                              cmp              arrowoffsetY, arrowAtExit
	                              je               CheckInMainMenu
	                              call             eraseArrows

	                              mov              bx, arrowStep
	                              ADD              arrowoffsetY, bx
	                              call             drawArrows

	                              jmp              CheckInMainMenu

	enterKey_label:               cmp              ah, key_enter                                                                        	; enter
