movShip1 PROC near

	                              cmp              al,key_esc                                                                           	; ESC
	                              jz               exitProg
	                              cmp              ah, 21H
	                              jz               movShip1_donotErase
	                              call             eraseShip1                                                                           	; get the pressed key from the user

	movShip1_donotErase:          cmp              ah,key_w
	                              jz               movShip1_moveUp

	                              cmp              ah,key_s
	                              jz               movShip1_moveDown

	                              cmp              ah,key_a
	                              jz               movShip1_moveLeft

	                              cmp              ah,key_d
	                              jz               movShip1_moveRight

	                              cmp              ah, key_f
	                              jz               movShip1_fire


	movShip1_readKey:             
	                              call             drawShip1

	                              mov              ah,0                                                                                 	;wait for a key to be pressed and put it in ah, ah:al = scan code: ASCII code
	                              int              16h

	                              mov              cx, 0                                                                                	; initialize cx to use it to iterate over the shipSize
	                              jmp              gameLoopRoutine


	movShip1_readFire:            

	                              mov              ah,0                                                                                 	;wait for a key to be pressed and put it in ah, ah:al = scan code: ASCII code
	                              int              16h

	                              mov              cx, 0                                                                                	; initialize cx to use it to iterate over the Bullet Size
	                              jmp              gameLoopRoutine
	;///////////////////////////////////////////////////////////////////////////////////////
	movShip1_moveUp:              
	;checking for boundaries
	                              mov              bx, shipOffsetY1
	                              cmp              bx, screenMinY1
	                              jna              movShip1_readKey
	                              sub              bx, shipSpeed1
	                              mov              DI, offset shipOffsetY1
	                              mov              [DI], bx

	                              jmp              movShip1_readKey

	movShip1_moveDown:            
	;checking for boundaries
	                              mov              bx, shipOffsetY1
	                              mov              cx, bx
	                              add              cx, shipSizeY1
	                              cmp              cx, screenMaxY1
	                              jnb              movShip1_readKey
	                              add              bx,shipSpeed1
	                              mov              DI, offset shipOffsetY1
	                              mov              [DI], bx

	                              jmp              movShip1_readKey

	movShip1_moveLeft:            
	;checking for boundaries
	                              mov              bx, shipOffsetX1
	                              cmp              bx, screenMinX1
	                              jna              movShip1_readKey
	                              sub              bx, shipSpeed1
	                              mov              DI, offset shipOffsetX1
	                              mov              [DI], bx
	          
	                              jmp              movShip1_readKey

	movShip1_moveRight:           
	;checking for boundaries
	                              mov              bx, shipOffsetX1
	                              mov              cx, bx
	                              add              cx, shipSizeX1
	                              cmp              cx, screenMaxX1
	                              jnb              movShip1_readKey
	                              add              bx, shipSpeed1
	                              mov              DI, offset shipOffsetX1
	                              mov              [DI], bx

	                              jmp              movShip1_readKey


	movShip1_fire:                
	                              mov              bx, 0
	                              LEA              SI, BulletDirection
	movShip1_findEmptyBullet:     MOV              DL, 0
	                              CMP              [SI], DL
	                              JE               movShip1_found
	                              CMP              BX, MAXBULLET
	                              JE               movShip1_notFound
	                              INC              BX
	                              INC              SI
	                              JMP              movShip1_findEmptyBullet
    
	movShip1_notFound:            ret

	movShip1_found:               mov              dl, 1
	                              mov              [SI], dl                                                                             	; For Right Direction
	                              LEA              DI, BulletOffset
	                              ADD              DI, BX
	                              ADD              DI, BX
	                              ADD              DI, BX
	                              ADD              DI, BX

	; For x
                    
	                              mov              dX, shipOffsetX1
	                              add              DX, shipSizeX1
	                              INC              DX
	                              MOV              [DI], DX
                
	; For y

	                              mov              dx, shipSizeY1
	                              sub              dx, BulletYSize

	; These steps for division
	; First push ax to stack as we need it after that
	                              push             ax

	; Divsion Process
	                              mov              ax, dx
	                              mov              cl, 2
	                              div              cl
	                              mov              dx, ax

	; retrive the value of reg ax
	                              pop              ax
	                              add              dx, shipOffsetY1

	                              mov              [DI] + 2, dx
	                              jmp              movShip1_readFire

	                      
	                              ret

movShip1 ENDP
