DrawBullet PROC near
	; initialize containers
	                              push             SI
	                              push             BX
	                              push             AX
	                              mov              AL, 2
	                              CMP              [SI], AL
	                              JZ               REVERSE
	                              mov              SI, offset Bullet
	                              mov              cx, BulletXSize                                                                      	;Column X
                        
